  true,\n\t\"url\": null,\n\t\"notes\": \"Building on our successful Phase I Tactile
  Data Entry program, Barron Associates proposes development of a Glove-Enabled Computer
  Operations (GECO) system to permit suited crewmembers to perform virtual keyboard/mouse
  interactions using an instrumented EVA glove.  The Phase II system will use two-hand
  motion tracking, multi-finger gesture recognition, and vibrotactile feedback to
  create an intuitive human-computer interface that mirrors familiar desktop data
  entry modalities. The program will deliver demonstration hardware and software compatible
  with laboratory, field, and on-orbit testing of crewmember performance in relevant
  data entry tasks.   The prototype will include functional EVA gloves with integrated
  motion sensing and vibrotactile transducers that couple to existing NASA suits via
  a quick-connect fitting.  We will produce right and left hand gloves, lower arm
  suit sections, and a specialized two-port acrylic glove box to enable human subject
  evaluations in a realistic pressurized environment.  Initial trials at Barron Associates
  will permit refinement of design concepts, followed by more extensive usability,
  comfort, and durability testing at NASA.  \",\n\t\"license_title\": \"U.S. Government
